import React, { Component } from 'react';
import styles from './illustration.module.scss';
import IllustrationsList from '../../components/IllustrationsList';
import IllustrationsData from "../../data/illustrationsData.json";

class Illustration extends Component {
    render() {
        const illustrationsData = IllustrationsData.data;
        return (
            <div>
                <section className={styles.content}>
                    <Route path="/illustrations/:id" exact component={ Illustration }></Route>
                </section>
                <section className={ styles.wrap }>
                    <div className={ styles.title }>
                        <div className={ styles.square }></div>
                        <p>« Ce moment, ces dix ans »</p>
                    </div>
                    <p className={ styles.subtitle }>images</p>
                </section>
                {/* <IllustrationList illustrationsData={ illustrationsData }/> */}
            </div>
        )
    }
}

export default Illustration;
